import React, { Component } from "react";
import Container from "react-dom";

class Card extends Component {
  render() {
    const { recipes } = this.props;
    return (
      <div>
        {{ recipes }.map((recipe) => {
          return <h2>{recipe.name}</h2>;
        })}
      </div>
    );
  }
}

export default Card;

